import React from "react";
import MessageList from "../containers/MessageList";

const MessageTimeline = props => {
  return (
    <div className="row">
      <UserAside profileImageUrl={props.profileImageUrl} username={props.username}/>
      <MessageList />
    </div>
  );
};

export default MessageTimeline;
